import React from 'react'
import { Link, Routes, Route } from 'react-router-dom'
import Login from './components/Login'

const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Login />}/>
      </Routes>

    </div>
  )
}

export default App
